    const navigate = useNavigate();

    const onLogOutClick = () =>{
        setIsLoggedIn(false)
        navigate("/")
    }
 
    const [date,setDate] = useState

    return(
        <>
            <span>Today</span>
            <span>new Date()</span>
            <button onClick={onLogOutClick}>Log out</button>
        </>
    )
}

export default Todo;
